resources.afterResponseScript:
try {
  const responseData = insomnia.response.json();
  const refreshToken = responseData.refreshToken;

  if (refreshToken) {
    insomnia.environment.set('REFRESH_TOKEN', refreshToken);
    console.log("Le refreshToken a été enregistré dans la variable d'environnement REFRESH_TOKEN");
  } else {
    console.log("Impossible de trouver le refreshToken dans la réponse");
  }
} catch (error) {
  console.log("Erreur lors du traitement de la réponse:", error.message);
}

