resources.preRequestScript:
let count = insomnia.environment.get("count") || 0;

const updateFields = () => {
  count++;
  const envName = `test${count}`;
  const envMail = `test${count}@test.fr`;

  insomnia.environment.set("dynamicName", envName);
  insomnia.environment.set("dynamicMail", envMail);
	insomnia.environment.set("count", count);
};

updateFields();
